INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "ヴルム", 2, 10007, 2002, "2023/12/22 14:59:59", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", "2023/09/15 15:00:00", 1, 127802, 1, 0.0, 0.0, 1);
