INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "アネモネ", 3, 10009, 2002, "2024/03/22 14:59:59", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", "2023/12/15 15:00:00", 1, 129602, 2, 0.0, 0.0, 1);
