INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "カノン", 4, 10013, 2002, "2024/06/22 14:59:59", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", "2024/03/15 15:00:00", 1, 130301, 3, 0.0, 3.1, 5);
