INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "ナーナ", 4, 10015, 2002, "2024/06/22 14:59:59", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", "2024/03/15 15:00:00", 1, 130401, 2, 0.0, 0.0, 2);
