INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "ホウオウ", 5, 10017, 2002, "2024/09/22 14:59:59", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", "2024/06/15 15:00:00", 1, 130502, 1, 0.0, 0.0, 1);
