INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "カリザ", 6, 10022, 2002, "2024/12/22 14:59:59", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", "2024/09/15 15:00:00", 1, 133301, 3, 0.0, 4.922, 1);
