INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "ミーア", 6, 10024, 2002, "2024/12/22 14:59:59", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", "2024/09/15 15:00:00", 1, 133401, 1, 0.0, 2.88, 2);
