INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "グレイス", 7, 10026, 2002, "2025/03/22 14:59:59", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", "2024/12/15 15:00:00", 1, 133002, 2, 0.0, 1.78, 1);
