INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "ルルィ", 8, 10030, 2002, "2025/06/23 14:59:59", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", "2025/03/15 15:00:00", 1, 136902, 2, 0.0, 5.53, 1);
