INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "デュラン", 8, 10032, 2002, "2025/06/23 14:59:59", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", "2025/03/15 15:00:00", 1, 137001, 2, 0.0, 0.0, 1);
