INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (-470.0, "サツキ", 9, 10034, 2002, "2025/09/22 14:59:59", "おう\n好きなもん持ってきな", "2025/06/16 15:00:00", 1, 135902, 2, 0.0, 0.0, 2);
